import React from 'react';
import p from './Profile.module.css';
const Post = () => {
  return (
    <div className={p.post}>
      <form>
        <textarea rows='12px' cols='13px'></textarea>
        <button>add text</button>
        <button>remove</button>
      </form>
    </div>
  );
};

export default Post;
